import React, { useEffect } from "react"
import axios from "axios"

const ViewExpenses = () => {

    useEffect(() => {
        axios.get("http://localhost:3000/expenses")
        .then(res => {
            console.log(res.data)
        })
    }, [])

    return (
        <div>View Expenses</div>
    )


}

export default ViewExpenses
